import React, { Fragment, useEffect } from "react";
import { Modal, Button } from "react-bootstrap";
const OutputModal = ({ show, handleClose, error }) => {
	const Body = () => {
		if (error === null) {
			return (
				<Modal.Body>
					<p>
						Your feedback has been successfully receiced. Thank you
						for getting in touch!
					</p>
				</Modal.Body>
			);
		} else {
			return (
				<Modal.Body>
					<p>Oops!! {error.messages}</p>
				</Modal.Body>
			);
		}
	};

	return (
		<Fragment>
			<Modal
				id="out"
				show={show}
				onShow={e => {
					const out = document.getElementById("out");
					if (error === null) {
						out.classList.remove(...out.classList);
						out.classList.add("bg-tertiary", "br-success");
					} else {
						out.classList.remove(...out.classList);
						out.classList.add(
							"br-danger-subtle",
							"bg-danger-subtle"
						);
					}
				}}
			>
				<Modal.Header closeButton>
					<Modal.Title>
						{(() => {
							return error === null ? "Success" : "Oops!!";
						})()}
					</Modal.Title>
				</Modal.Header>
				<Modal.Body>
					<p>
						{(() => {
							if (error !== null) {
								alert(error.message);
							}
							return error !== null
								? error.message
								: "Thank you for getting in touch. I look forward to your message!";
						})()}
						ff
					</p>
				</Modal.Body>
				<Modal.Footer>
					<Button variant="primary" onClick={handleClose}>
						Ok
					</Button>
				</Modal.Footer>
			</Modal>
		</Fragment>
	);
};

export default OutputModal;
